          <div class="click_ways" @click="clickWays()">
            <span v-if="(!has_return) && (!is_multi_destination)">{{ useXmltag('Oneway') }}</span>
            <span v-else-if="(has_return)">{{ useXmltag('Twoway') }}</span>
            <span v-else-if="is_multi_destination"> {{ useXmltag('multiSearch') }}</span>
            <i class="fa fa-angle-down mr-auto"></i>
          </div>

          <div class="box_ways">
            <div @click="changeTypeSearch('Oneway',$event)" class="is_active_box_ways">{{ useXmltag('Oneway') }}</div>
            <div @click="changeTypeSearch('Twoway',$event)" class="multiWays" :class="(has_return ? 'checked' : '')">{{ useXmltag('Twoway') }}</div>
            <div @click="changeTypeSearch('multiSearch',$event)" v-if="searchSource">{{ useXmltag('multiSearch') }}</div>
          </div>
        </div>

        </div>
      </div>
      <div id="accordion">

        <part-search-side v-for='(dataSearch,key_search) in data_search_side' :key="key_search" :index_key="key_search"  :dataSearch="dataSearch"
                          :other_data_search='other_data_search' :count_search_part="count_search_part" :is_multi_destination="is_multi_destination" @delete_path_flight="delete_path_flight" ></part-search-side>
      </div>
      <div class="button_plus_multi col-9 mx-auto my-2 d-flex justify-content-center" v-if="is_multi_destination">
        <button type="button" id="create_search_box" class="site-bg-color-dock-border mx-auto px-3 site-main-bg-color-h site-border-main-color" @click='addPatternPartSearchSide()'>
          <i class='fa fa-plus ml-2'></i>
           {{ useXmltag('add_path') }}
        </button>
      </div>
