              <i class="plus zmdi zmdi-plus-circle site-main-text-color-h "
                 id="addQtyForeign2"></i>
              <span>
                  <input class="site-main-text-color-drck" id="qtyf2" type="text" v-model="other_data_search.child"  name="child" min="0" max="9">
                       {{ useXmltag('Child') }}
              </span>
              <input type="hidden" name="child_qty" id="child_qty" v-model="other_data_search.child">
              <i class="minus zmdi zmdi-minus-circle site-main-text-color-h "
                 id="minusQtyForeign2"></i>
