              <i class="plus zmdi zmdi-plus-circle site-main-text-color-h "
                 id="addQtyForeign3"></i>
              <span>
                 <input class="site-main-text-color-drck" id="qtyf3" type="text" v-model="other_data_search.infant"  name="infant" min="0" max="9">
                    {{ useXmltag('Baby') }}
              </span>
              <input type="hidden" name="infant_qty" id="infant_qty" v-model="other_data_search.infant">
              <i class="minus zmdi zmdi-minus-circle site-main-text-color-h "
                 id="minusQtyForeign3"></i>
            </p>
          </div>
        </div>


      </div>
      <div class="s-u-search-wrapper s-u-num-inp s-u-num-inp-search-change">
        <a href="" @click="event.preventDefault()" class="f-loader-check f-loader-check-bar"
           id="loader_check_submit" style="display:none"></a>

        <button type="button" @click="submitLocalSide('international')" id="sendFlight"
                class="site-bg-main-color"> {{ useXmltag('Search') }}
        </button>
      </div>
      <input type='hidden' id='is_multi_destination' v-model='is_multi_destination'>
      <input type='hidden' id='count_path' v-model='count_search_part'>
    </form>
    <div class="message_error_portal"></div>
  </div>
</template>
<script>
  import partSearchSide from './partSearchSide'
  export default {
    name: 'mainSidebar',
    props: [ 'dataSearch', 'countFlights'],
    components:{
      'partSearchSide': partSearchSide
    },
    data() {
      return {
        data_search: [],
        other_data_search: [],
        count_search_part : 0,
        data_search_side:[],
        is_multi_destination : false,
        svg_icon_1: `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="512" height="512" viewBox="0 0 512 512"><image x="53" y="16" width="406" height="480" xlink:href="data:img/png;base64,"/></svg>`,
        svg_icon_2: `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="1536" height="1536" viewBox="0 0 512 512"><image x="76" y="16" width="360" height="480" xlink:href="data:img/png;base64,"/></svg>`,
        svg_icon_3: `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="512" height="512" viewBox="0 0 512 512"><image y="16" width="512" height="480" xlink:href="data:img/png;base64,"/></svg>`,
        boxWays:"",
        boxWaysHeight : "",
        has_return : false,
        search_box_type : 'multiSearch'

      }
    },
    methods: {

      clickWays(){
        this.boxWays.classList.toggle("active_h_boxWays");
        document.querySelector('.click_ways > i').classList.toggle("active_i_click_ways")
        document.querySelector('.click_ways').classList.toggle("site-border-main-color")
      },
      delete_path_flight(value){
        let final_array =  this.data_search_side.filter((flight,index) => {
          if(index !== parseInt(value)){
            return flight
          }
        });
        this.data_search_side = final_array ;
        this.count_search_part=  this.data_search_side.length;

      },
      changeTypeSearch: function(type_search_box,event) {
        let selector_div = document.querySelectorAll('.box_ways > div');
        this.$store.commit('setSearchType',type_search_box)

        console.log('selector_div' , selector_div)
        selector_div.forEach(div => {
          div.classList.remove('is_active_box_ways');
        });
        document.querySelector('.click_ways').classList.toggle("site-border-main-color")
        this.boxWays.classList.toggle("active_h_boxWays");
        document.querySelector('.click_ways > i').classList.toggle("active_i_click_ways")
        event.target.classList.add("is_active_box_ways")

          if(type_search_box=='Oneway'){
              this.is_multi_destination = false;
              this.has_return = false;
            document.getElementsByClassName('multiWays')[0].classList.remove('checked');


          }
        console.log(type_search_box)
          if(type_search_box=='Twoway'){
            this.is_multi_destination = false;
            this.has_return = true;
            console.log('document.getElementsByClassName(\'multiWays\')[0]: ' , document.getElementsByClassName('multiWays')[0])
            document.getElementsByClassName('multiWays')[0].classList.add('checked');
          }
          if(type_search_box=='multiSearch'){
            this.is_multi_destination = true;
            this.has_return = false;
            document.getElementsByClassName('multiWays')[0].classList.remove('checked');

          }
      },
      addPatternPartSearchSide(){

        if(this.count_search_part < 4){

          this.data_search_side.push({
            'origin' : '',
            'destination' : '',
            'departureDate' : '',
            'name_departure':'',
            'airport_departure':'',
            'country_departure':'',
            'name_arrival':'',
            'airport_arrival':'',
            'country_arrival':'',
            'count_path':'',
          })

          this.count_search_part=  this.data_search_side.length;

        }


      }


    },
    watch: {
      dataSearch() {
        let _this = this
        if (_this.dataSearch) {
              if(_this.dataSearch.dataSearch.MultiWay == 'multi_destination'){
                _this.is_multi_destination = true;
              }
            _this.data_search_side =   _this.dataSearch.dataSearch.info;
            _this.other_data_search =  _this.dataSearch.dataSearch;
            _this.count_search_part =  _this.data_search_side.length;
            _this.has_return =  (_this.dataSearch.dataSearch.MultiWay == 'TwoWay') ? true : false;

            if(_this.dataSearch.dataSearch.MultiWay == 'TwoWay'){
              this.$store.commit('setSearchType','Twoway')
            }else if(_this.dataSearch.dataSearch.MultiWay =='multi_destination'){
              this.$store.commit('setSearchType','multiSearch')
            }else{
              this.$store.commit('setSearchType','Oneway')
            }


        }
      }
    },
    mounted(){
      this.boxWays = document.querySelector(".box_ways");
      this.boxWaysHeight = document.querySelector(".box_ways").offsetHeight;
      this.boxWays.style.height = "0";
      this.boxWays.style.opacity = "0";
    },
    created:function() {
      this.$store.dispatch('getSearchSources', {method: 'getSourceClient'});
    },
    computed:{
      searchSource(){
        let data_sources = this.$store.state.search_sources ;
        let result_parto = false ;

        data_sources.forEach(element =>{

          if(element.isActiveExternal ==='1' && element.sourceCode ==='14' && element.SourceTbId === '20'){
             result_parto = true ;
          }

        });

        return result_parto ;
      }
    }
  }
</script>